import React, { UseState } from 'react';
import './App.css';

import Header from './Header';

function App() {
  const counter = useState(0);

  function handleButtonClick() {
    counter++
  }

  return (     
    <div>
      <Header title="Hellow World, Lucas" />

      <h1>{counter}</h1>
      <button type="button" onClick={handleButtonClick}>Aumentar</button>
    </div>
  );
}

export default App;
